import hrimg from '../images/hrimg.webp'
import Module from './Module'
import { useState } from 'react'


function Moduleone() {

    let [tab1, settab1] = useState(true)

    let [tab2, setTab2] = useState(false)

    let [tab3, setTab3] = useState(false)

    let [back , setback] = useState(true)

    function handletab1() {
        settab1(true)
        setTab2(false)
        setTab3(false)
    }

    function handletab2() {
        setTab2(true)
        settab1(false)
        setTab3(false)
    }

    function handletab3() {
        setTab3(true)
        setTab2(false)
        settab1(false)
    }

    function handleback(){
        setback(false)
    }

    return (
        <>
            {
                back === true ? <Module/>
                :""
            }



        </>
    )
}

export default Moduleone
